import React from "react"
import kanyeoutline from "../img/kanyeoutline"

class Default extends React.Component{
    render () {
        return(
            <div className="h-screen">
                <p className="font-heading">Help us find Kanye!</p>
                <p className="">Kanye has fell in a pool of coffee beans, and we can't find him. Try and find him before it is too late!</p>
                <img src={kanyeoutline} alt="" class="h-100 w-100 animate-bounce"/>
            </div>
        )
    }
}

export default Default
